import React, { useState } from 'react'

const Map = props => {

  return (
    <div id="google-map">
      Map
    </div>
  )
}

function initMap() {
  new google.maps.Map(document.getElementById('map'), {
    center: {lat: -34.397, lng: 150.644},
    zoom: 8,
  });
}

export default Map
